    GameObject.call(this, renderableObj);
    this.mCircleBound = false;
    this.mCollidableFlag = false;
    this.mCollisionPixelFlag = false;
    this.mDestroy = false;
}
gEngine.Core.inheritPrototype(window["ScoreKeeper"], window["GameObject"]);

ScoreKeeper.prototype.update = function() {
    //GameObject.prototype.update.call(this);
    var i;
    var list = gCurrentScene.getInstanceList();
    var count = 0;
    for (i = 0; i < list.length; i++) {
        if (list[i] instanceof Brick) {
            count++;
        }
    }
    if (count === 0) {
        switchScene("Win");
    }
};

